model.compile(loss='mae', optimizer='adam')


def train(data):
    data.shape = (200, 10, 2)
    model.fit(data, data, epochs=50, batch_size=20, validation_data=(data, data), verbose=0, shuffle=False,
              callbacks=[LossHistory()])
    data.shape = (2000, 2)


def score(data):
    data.shape = (200, 10, 2)
    yhat = model.predict(data)
    print('score shape', np.shape(yhat))
    yhat.shape = (2000, 2)
    return yhat


